import logo from "./eventlylogo.svg";
import { Link } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Router>
        <navbar />
        <Switch>
          <Route path="/" exact component={Dogs} />
          <Route path="/cats" component={Cats} />
          <Route path="/sheeps" component={Sheeps} />
          <Route path="/goats" component={Goats} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
